import { createClient } from 'liferay-headless-rest-client';
import { postConfigurationWizardMode } from 'liferay-headless-rest-client/analytics-settings-rest-v1.0';

const client = createClient({
    baseUrl: 'http://localhost:8080',
    headers: {
        Authorization: `Basic ${btoa("test@liferay.com:test")}`,
    },
});

async function main() {
    const { data } = await postConfigurationWizardMode({
        client,

    });

    console.log(data);
}

const response = await Liferay.Util.fetch('/o/analytics-settings-rest/v1.0/configuration/wizard-mode', {
  method: 'POST',
})

const data = await response.json();

console.log(data);

